import './App.css';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';

export default function App(){
    return(

        <div className='App'>
            <Container className='h-100'>
                <Row>
                    <Card>
                        <Card.Footer className="d-flex justify-content-between">
                            <Button>Previous</Button>
                            <Button>Next</Button>
                        </Card.Footer>
                    </Card>
                </Row>
            </Container>
        </div>
    );
}
